// src/App.js
import React from 'react';
import { Carousel } from 'react-responsive-carousel';
import 'react-responsive-carousel/lib/styles/carousel.min.css';

const styles = {
  app: {
    textAlign: 'center',
    backgroundColor: '#f4f4f4',
    minHeight: '100vh',
    display: 'flex',
    flexDirection: 'column',
  },
  header: {
    backgroundColor: '#333',
    color: 'white',
    padding: '20px',
  },
  nav: {
    backgroundColor: '#444',
    color: 'white',
    padding: '20px',
    display: 'flex',
    justifyContent: 'space-between',
    alignItems: 'center',
    height: '40px',
  },
  logo: {
    marginLeft: '20px',
    fontSize: '1.5rem',
    fontWeight: 'bold',
  },
  navUl: {
    listStyleType: 'none',
    padding: 0,
    display: 'flex',
    justifyContent: 'center',
    alignItems: 'center',
  },
  navLi: {
    margin: '0 15px',
    cursor: 'pointer',
  },
  loginButton: {
    backgroundColor: '#555',
    color: 'white',
    padding: '10px 15px',
    borderRadius: '5px',
    cursor: 'pointer',
    marginRight: '20px',
  },
  sliderContainer: {
    maxWidth: '800px',
    margin: '20px auto',
  },
  main: {
    flex: 1,
    padding: '20px',
  },
  footer: {
    backgroundColor: '#333',
    color: 'white',
    padding: '20px',
    position: 'fixed',
    bottom: 0,
    width: '100%',
  },
};

const Header = () => {
  return (
    <header style={styles.header}>
      {/* Removed website name */}
    </header>
  );
};

const NavBar = () => {
  return (
    <nav style={styles.nav}>
      <div style={styles.logo}>Logo</div>
      <ul style={styles.navUl}>
        <li style={styles.navLi}>Home</li>
        <li style={styles.navLi}>Our Missions</li>
        <li style={styles.navLi}>About Us</li>
        <li style={styles.navLi}>Clubs</li>
        <li style={styles.navLi}>Contact Us</li>
      </ul>
      <div style={styles.loginButton}>Login</div>
    </nav>
  );
};

const ImageSlider = () => {
  return (
    <div style={styles.sliderContainer}>
      <Carousel>
        <div>
          <img alt="Slide 1" src="https://via.placeholder.com/800x300" />
        </div>
        <div>
          <img alt="Slide 2" src="https://via.placeholder.com/800x300" />
        </div>
        <div>
          <img alt="Slide 3" src="https://via.placeholder.com/800x300" />
        </div>
      </Carousel>
    </div>
  );
};

const MainContent = () => {
  return (
    <main style={styles.main}>
      <ImageSlider />
      <p>Welcome to my website! This is the main content.</p>
    </main>
  );
};

const Footer = () => {
  return (
    <footer style={styles.footer}>
      <p>&copy; 2024 My Website. All rights reserved.</p>
    </footer>
  );
};

function App() {
  return (
    <div style={styles.app}>
      <Header />
      <NavBar />
      <MainContent />
      <Footer />
    </div>
  );
}

export default App;
